import About_me from './components/About_me.js';
import Work_experience from './components/Work_experience.js';
import Projects from './components/Projects.js';
import "tachyons";

class App extends Component{

  render(){
    return (
      <div className="App">
        <div className='w-25 bg-light-gray'>

        </div>
      	<div className="fl bg-light-gray">
          <About_me/>
          <Work_experience/>
          <Projects/>

      	</div>

      </div>
    );
  }
}

export default App;
